LA PRIDE thank you so much!!!This was a moment I will never forget… the literal blood sweat and tears that went into this set! It was all worth it.  Being up on the main stage and having that moment and knowing MC was going to be on the same stage later that night DEAD. 
Thank you so much @haleymessick for all your help with this show… I literally wouldn’t have gotten through it without you. You are literally an Angel on this earth. The incredible dancers that worked sooooo hard, my brother @iamjustdalton for holding me down show day and glamming me up and beating my face.  @samjgarfield for helping all my ideas come to life in this show mix. My agent @petejengle for working so hard with me for this one. 
@lapride for having me!!!!!! This is the first of many posts.  Get ready for content lol.  Huge shout out to @orttu_official for the custom looks on stage.  Everything I am wearing is full @orttu_official. 

